import React from 'react';

const Banner = ({ imageUrl }) => {
  return (
    <div style={{ width: '100%', height: 'auto' }}>
      <img src={imageUrl} alt="Banner" style={{ width: '100%' }} />
    </div>
  );
};

export default Banner;
